import {GET_ALL_STUDIES} from '../apiConfig'
import { USERS_URL } from '../apiConfig';
import { GET_ALL_USERLIST } from '../apiConfig';
import { LOGIN_URL } from '../apiConfig';

const axios = require('axios').default; 

export function getAllLanguages(){
       return axios.get(GET_ALL_STUDIES)
            .then(function (response) {
                // handle success
                return response.data;
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })

}

export function getAllUserList(){
    return axios.get(GET_ALL_USERLIST)
         .then(function (response) {
             // handle success
             return response.data;
         })
         .catch(function (error) {
             // handle error
             console.log(error);
         })

}
